import { Container ,Paper,Button} from '@material-ui/core';
import { useNavigate } from "react-router-dom"

export const Main = () => {
    const navigate = useNavigate()
    return (
        <div> 
            <div className = "left">
            <Button variant="contained" color="secondary" onClick={(e) =>navigate("/")}>
                Add student
            </Button>
            </div>

            <div className = "right">
            <Button variant="contained" color="secondary" onClick={(e) => navigate("/club")}>
                Add club
            </Button>
            </div>
        </div>
    )
}
